import React from 'react'
import './TopNav.css'

const TopNav = () => {
    return (
        <div className="top-nav">
            <img className="spacex-logo" src="https://upload.wikimedia.org/wikipedia/commons/9/96/SpaceX_Logo_Black.png" alt="spacex-logo" />
        </div>
    )
}

export default TopNav
